// @flow
import React from 'react';
import { useForm } from 'react-hook-form';
import { Row, Col, Card, Form, FloatingLabel, InputGroup, Button, Dropdown, DropdownButton } from 'react-bootstrap';

// components
import PageTitle from '../../components/PageTitle';
import { FormInput } from '../../components/';

const BasicInputElements = () => {
    /*
     * form methods
     */
    const methods = useForm({
        defaultValues: {
            password: '12345',
            statictext: 'email@example.com',
            color: '#727cf5',
        },
    });
    const {
        handleSubmit,
        register,
        control,
        formState: { errors },
    } = methods;

    return (
        <>
            <Card>
                <Card.Body>
                    <h4 className="header-title">Input Types</h4>
                    <p className="text-muted">
                        Most common form control, text-based input fields. Includes support for all HTML5 types:{' '}
                        <code>text</code>, <code>password</code>, <code>datetime</code>, <code>datetime-local</code>,{' '}
                        <code>date</code>, <code>month</code>, <code>time</code>, <code>week</code>, <code>number</code>
                        , <code>email</code>, <code>url</code>, <code>search</code>, <code>tel</code>, and{' '}
                        <code>color</code>.
                    </p>

                    <Row>
                        <Col lg={6}>
                            <form onSubmit={handleSubmit()}>
                                <FormInput
                                    label="Text"
                                    type="text"
                                    name="text"
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="text"
                                    errors={errors}
                                    control={control}
                                />

                                <FormInput
                                    label="Email"
                                    type="email"
                                    name="email"
                                    placeholder="Email"
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="email"
                                    errors={errors}
                                    control={control}
                                />

                                <FormInput
                                    label="Show/Hide Password"
                                    type="password"
                                    name="password"
                                    placeholder="password placeholder"
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="password"
                                    errors={errors}
                                    control={control}
                                />

                                <FormInput
                                    label="Placeholder"
                                    type="text"
                                    name="placeholder"
                                    placeholder="placeholder"
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="placeholder"
                                    errors={errors}
                                    control={control}
                                />

                                <FormInput
                                    label="Text Area"
                                    type="textarea"
                                    name="textarea"
                                    rows="5"
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="textarea"
                                    errors={errors}
                                    control={control}
                                />

                                <FormInput
                                    label="Read only"
                                    type="text"
                                    name="text1"
                                    id="text1"
                                    placeholder="Readonly value"
                                    readOnly
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="text1"
                                    errors={errors}
                                    control={control}
                                />

                                <FormInput
                                    label="Disabled"
                                    type="text"
                                    name="text2"
                                    id="text2"
                                    placeholder="Disabled value"
                                    disabled
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="text2"
                                    errors={errors}
                                    control={control}
                                />

                                <FormInput
                                    label="Static control"
                                    type="text"
                                    name="statictext"
                                    placeholder="Disabled"
                                    plaintext
                                    readOnly
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="statictext"
                                    errors={errors}
                                    control={control}
                                />

                                <Form.Group className="mb-3">
                                    <Form.Label htmlFor="text3" className="form-label">
                                        Helping text
                                    </Form.Label>
                                    <Form.Control type="text" name="text" id="text3" placeholder="Helping text" />
                                    <Form.Text>
                                        A block of help text that breaks onto a new line and may extend beyond one line.
                                    </Form.Text>
                                </Form.Group>
                            </form>
                        </Col>

                        <Col lg={6}>
                            <form onSubmit={handleSubmit()}>
                                <FormInput
                                    name="select"
                                    label="Input Select"
                                    type="select"
                                    containerClass="mb-3"
                                    className="form-select"
                                    register={register}
                                    key="select"
                                    errors={errors}
                                    control={control}>
                                    <option>1</option>
                                    <option>2</option>
                                    <option>3</option>
                                    <option>4</option>
                                    <option>5</option>
                                </FormInput>

                                <FormInput
                                    name="selectMulti"
                                    label="Multiple Select"
                                    type="select"
                                    multiple
                                    containerClass="mb-3"
                                    className="form-select"
                                    register={register}
                                    key="selectMulti"
                                    errors={errors}
                                    control={control}>
                                    <option>1</option>
                                    <option>2</option>
                                    <option>3</option>
                                    <option>4</option>
                                    <option>5</option>
                                </FormInput>

                                <FormInput
                                    label="Default file input"
                                    type="file"
                                    name="file"
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="file"
                                    errors={errors}
                                    control={control}
                                />

                                <FormInput
                                    label="Date"
                                    type="date"
                                    name="date"
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="date"
                                    errors={errors}
                                    control={control}
                                />

                                <FormInput
                                    label="Month"
                                    type="month"
                                    name="month"
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="month"
                                    errors={errors}
                                    control={control}
                                />

                                <FormInput
                                    label="Time"
                                    type="time"
                                    name="time"
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="time"
                                    errors={errors}
                                    control={control}
                                />

                                <FormInput
                                    label="Week"
                                    type="week"
                                    name="week"
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="week"
                                    errors={errors}
                                    control={control}
                                />

                                <FormInput
                                    label="Number"
                                    type="number"
                                    name="number"
                                    placeholder="number placeholder"
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="number"
                                    errors={errors}
                                    control={control}
                                />

                                <FormInput
                                    label="Color"
                                    type="color"
                                    name="color"
                                    placeholder="color placeholder"
                                    className="w-100"
                                    containerClass={'mb-3'}
                                    register={register}
                                    key="color"
                                    errors={errors}
                                    control={control}
                                />

                                <Form.Group className="mb-0">
                                    <Form.Label htmlFor="exampleRange" className="form-label">
                                        Range
                                    </Form.Label>
                                    <Form.Range />
                                </Form.Group>
                            </form>
                        </Col>
                    </Row>
                </Card.Body>
            </Card>
        </>
    );
};

const FloatingLabels = () => {
    return (
        <>
            <Card>
                <Card.Body>
                    <h4 className="header-title">Floating labels</h4>
                    <p className="text-muted">
                        Wrap a <code>&lt;Form.Control&gt;</code> element in <code>&lt;FloatingLabel&gt;</code>
                        to enable floating labels with Bootstraps textual form fields. A <code>placeholder</code>
                        is required on each <code>&lt;Form.Control&gt;</code> as our method of CSS-only floating labels
                        uses the <code>:placeholder-shown</code> pseudo-element.
                    </p>

                    <Row>
                        <Col lg={6}>
                            <h5 className="mb-3">Example</h5>
                            <FloatingLabel controlId="floatingInput" label="Email address" className="mb-3">
                                <Form.Control type="email" placeholder="name@example.com" />
                            </FloatingLabel>
                            <FloatingLabel controlId="floatingPassword" label="Password">
                                <Form.Control type="password" placeholder="Password" />
                            </FloatingLabel>

                            <h5 className="mb-3 mt-4">Textareas</h5>
                            <FloatingLabel controlId="floatingTextarea2" label="Comments">
                                <Form.Control
                                    as="textarea"
                                    placeholder="Leave a comment here"
                                    style={{ height: '100px' }}
                                />
                            </FloatingLabel>
                        </Col>

                        <Col lg={6}>
                            <h5 className="mb-3">Selects</h5>
                            <FloatingLabel controlId="floatingSelect" label="Works with selects">
                                <Form.Select aria-label="Floating label select example">
                                    <option>Open this select menu</option>
                                    <option value="1">One</option>
                                    <option value="2">Two</option>
                                    <option value="3">Three</option>
                                </Form.Select>
                            </FloatingLabel>

                            <h5 className="mb-3 mt-4">Layout</h5>
                            <Row className="g-2">
                                <Col md>
                                    <FloatingLabel controlId="floatingInputGrid" label="Email address">
                                        <Form.Control type="email" placeholder="name@example.com" />
                                    </FloatingLabel>
                                </Col>
                                <Col md>
                                    <FloatingLabel controlId="floatingSelectGrid" label="Works with selects">
                                        <Form.Select aria-label="Floating label select example">
                                            <option>Open this select menu</option>
                                            <option value="1">One</option>
                                            <option value="2">Two</option>
                                            <option value="3">Three</option>
                                        </Form.Select>
                                    </FloatingLabel>
                                </Col>
                            </Row>
                        </Col>
                    </Row>
                </Card.Body>
            </Card>
        </>
    );
};

const SelectInput = () => {
    return (
        <>
            <h4 className="header-title">Select menu</h4>
            <p className="text-muted">
                Custom <code>&lt;select&gt;</code> menus need only a custom class, <code>.custom-select</code> to
                trigger the custom styles.
            </p>

            <Form.Group>
                <Form.Select className="custom-select mt-3" aria-label="Default select example">
                    <option>1</option>
                    <option>2</option>
                    <option>3</option>
                    <option>4</option>
                    <option>5</option>
                </Form.Select>
            </Form.Group>
        </>
    );
};

const Switches = () => {
    return (
        <>
            <h4 className="header-title mt-4">Switches</h4>
            <p className="text-muted">
                A switch has the markup of a custom checkbox but uses the <code>.custom-switch</code> class to render a
                toggle switch. Switches also support the <code>disabled</code> attribute.
            </p>

            <Form>
                <Form.Check type="switch" id="custom-switch" label="Toggle this switch element" />
                <Form.Check
                    disabled
                    type="switch"
                    label="Disabled switch element"
                    id="disabled-custom-switch"
                    className="mt-1"
                />
            </Form>
        </>
    );
};

const CustomCheckboxes = () => {
    return (
        <>
            <Form.Group>
                <Form.Label className="form-label" htmlFor="exampleCheckbox">
                    Checkboxes
                </Form.Label>
                <div>
                    <Form.Check type="checkbox" id="default-checkbox" label="Check this custom checkbox" />
                    <Form.Check type="checkbox" id="default-checkbox" label="But not this disabled one" disabled />
                </div>
            </Form.Group>
        </>
    );
};

const InlineCustomCheckboxes = () => {
    return (
        <Form.Group className="mt-2">
            <Form.Label className="form-check-label" htmlFor="exampleCheckbox">
                Inline
            </Form.Label>
            <div>
                <Form.Check type="checkbox" id="inline-checkbox" label="An inline custom input" />
                <Form.Check type="checkbox" id="inline-checkbox" label="and another one" />
            </div>
        </Form.Group>
    );
};

const CustomRadios = () => {
    return (
        <Form.Group className="mt-2">
            <Form.Label className="form-label" htmlFor="exampleCheckbox">
                Radios
            </Form.Label>
            <div>
                <Form.Check type="radio" id="default-checkbox" label="Check this custom checkbox" />
                <Form.Check type="radio" id="default-checkbox" label="But not this disabled one" disabled />
            </div>
        </Form.Group>
    );
};

const InputSizes = () => {
    return (
        <Card>
            <Card.Body>
                <h4 className="header-title">Input Sizes</h4>
                <p className="text-muted">
                    Use size on <code>&lt;FormControl&gt;</code> and <code>&lt;FormLabel&gt;</code> to change the size
                    of inputs and labels respectively.
                </p>

                <Form>
                    <Form.Group className="mb-3">
                        <Form.Label htmlFor="small">Small</Form.Label>
                        <Form.Control type="text" name="small" id="small" placeholder="Small" size="sm" />
                    </Form.Group>

                    <Form.Group className="mb-3">
                        <Form.Label htmlFor="Normal">Normal</Form.Label>
                        <Form.Control type="text" name="Normal" id="Normal" placeholder="Normal" />
                    </Form.Group>

                    <Form.Group className="mb-3">
                        <Form.Label htmlFor="Large">Large</Form.Label>
                        <Form.Control type="text" name="Large" id="Large" placeholder="Large" size="lg" />
                    </Form.Group>

                    <Form.Group className="mb-0">
                        <Form.Label htmlFor="grid">Grid Sizes</Form.Label>
                        <Row>
                            <Col sm={4}>
                                <Form.Control type="text" name="grid" id="grid" placeholder=".col-sm-4" />
                            </Col>
                        </Row>
                    </Form.Group>
                </Form>
            </Card.Body>
        </Card>
    );
};

const InputGroups = () => {
    return (
        <Card>
            <Card.Body>
                <h4 className="header-title">Input Group</h4>
                <p className="text-muted">
                    Easily extend form conrols by adding text, buttons, or button groups on either side of textual
                    inputs, custom selects, and custom file inputs
                </p>

                <Form>
                    <Form.Group>
                        <Form.Label htmlFor="Static">Static</Form.Label>
                        <InputGroup className="mb-3">
                            <InputGroup.Text id="basic-addon1">@</InputGroup.Text>
                            <Form.Control
                                placeholder="Username"
                                aria-label="Username"
                                aria-describedby="basic-addon1"
                            />
                        </InputGroup>
                    </Form.Group>

                    <Form.Group>
                        <Form.Label htmlFor="Dropdown">Dropdown</Form.Label>
                        <InputGroup className="mb-3">
                            <DropdownButton variant="primary" title="Dropdown" id="input-group-dropdown-1">
                                <Dropdown.Item href="#">Action</Dropdown.Item>
                                <Dropdown.Item href="#">Another action</Dropdown.Item>
                                <Dropdown.Item href="#">Something else here</Dropdown.Item>
                                <Dropdown.Divider />
                                <Dropdown.Item href="#">Separated link</Dropdown.Item>
                            </DropdownButton>
                            <Form.Control aria-label="Text input with dropdown button" />
                        </InputGroup>
                    </Form.Group>

                    <Form.Group>
                        <Form.Label htmlFor="Button">Button</Form.Label>
                        <InputGroup className="mb-3">
                            <Form.Control
                                placeholder="Recipient's username"
                                aria-label="Recipient's username"
                                aria-describedby="basic-addon2"
                            />
                            <Button variant="dark" id="button-addon2">
                                Button
                            </Button>
                        </InputGroup>
                    </Form.Group>

                    <Row className="g-2">
                        <Col sm={6}>
                            <Form.Group>
                                <Form.Label htmlFor="file">File input</Form.Label>
                                <Form.Control type="file" />
                            </Form.Group>
                        </Col>
                        <Col sm={6}>
                            <Form.Group>
                                <Form.Label htmlFor="formFileMultiple01">Multiple input</Form.Label>
                                <Form.Control type="file" multiple />
                            </Form.Group>
                        </Col>
                    </Row>
                </Form>
            </Card.Body>
        </Card>
    );
};

const DefaultForm = () => {
    return (
        <Card>
            <Card.Body>
                <h4 className="mb-3 header-title">Basic Example</h4>

                <Form>
                    <Form.Group className="mb-3">
                        <Form.Label htmlFor="exampleEmail2">Email</Form.Label>
                        <Form.Control type="email" name="email" id="exampleEmail2" placeholder="Enter your email" />
